import React, { useState, useEffect } from 'react';
import axios from 'axios';
import { Link, useParams } from 'react-router-dom';
import Header from '../components/Header';
import './MyPerformances.css';

function MyPerformances() {
  const { user_id } = useParams();
  const [performances, setPerformances] = useState([]);

  useEffect(() => {
    const fetchPerformances = async () => {
      try {
        const response = await axios.get(`/dailband/user/${user_id}/performances`);
        console.log('User performances response:', response.data);
        setPerformances(response.data.performances);
      } catch (error) {
        console.error('Failed to fetch user performances:', error);
      }
    };

    fetchPerformances();
  }, [user_id]);

  const handleDeletePerformance = async (performanceId) => {
    try {
      await axios.delete(`/dailband/user/${user_id}/performances/${performanceId}`);
      setPerformances(performances.filter(performance => performance.performance_id !== performanceId));
    } catch (error) {
      console.error('Failed to delete performance:', error);
    }
  };

  return (
    <div className="MyPerformances">
      <Header />
      <div className="MyPerformances-container">
        <div className="Sidebar">
          <div className="Profile-picture">
            <img src="/path/to/default-profile.png" alt="프로필 사진" />
          </div>
          <h2>사용자 닉네임</h2>
          <Link to={`/profile/edit/${user_id}`}>프로필 수정</Link>
          <Link to={`/scrap/${user_id}`}>스크랩</Link>
          <Link to={`/myposts/${user_id}`}>내가 쓴 글</Link>
          <Link to={`/myperformances/${user_id}`} className="active">내가 작성한 공연 조회</Link>
          <Link to={`/myreservations/${user_id}`}>공연 예약</Link>
        </div>
        <div className="Content">
          <h2>내가 작성한 공연 조회</h2>
          {performances.length === 0 ? (
            <p>작성한 공연이 없습니다.</p>
          ) : (
            <ul className="PerformancesList">
              {performances.map((performance) => (
                <li key={performance.performance_id} className="PerformanceItem">
                  <div>
                    <Link to={`/performance/${performance.performance_id}`}>
                      <h4>{performance.title}</h4>
                      <p>{performance.content}</p>
                    </Link>
                    <p>작성날짜: {new Date(performance.date).toLocaleDateString()}</p>
                    <p>장소: {performance.venue}</p>
                  </div>
                  <button onClick={() => handleDeletePerformance(performance.performance_id)}>삭제</button>
                </li>
              ))}
            </ul>
          )}
        </div>
      </div>
    </div>
  );
}

export default MyPerformances;
